import React from "react";
import {
	BrowserRouter as Router,
	Route,
	Switch,
	Redirect,
} from "react-router-dom";

export default () => {
	return (
		<Router>
			<Route path="/:path?" exact>
				<HomeWrap>
					<Switch>
						<Route path="/" exact component={Pokemons} />
					</Switch>
				</HomeWrap>
			</Route>
		</Router>
	);
};
